import React from "react";

const PokemonList = ({ pokemons }) => {
  return (
    <div>
      <h2>Cartas Cadastradas</h2>
      <ul>
        {pokemons.map((pokemon, index) => (
          <li key={index}>
            <p>Nome: {pokemon.name}</p>
            <p>Tipo: {pokemon.type}</p>
            <p>HP: {pokemon.hp}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PokemonList;
